import react from 'react'


const Registro = () => {
const handleSubmit = () => {}     
const registroForm = () => (
<form onSubmit={handleSubmit}>Formulario Registro
<input type="email" className="form-control" ></input></form>
)
return (
        <div className="container p-5">
           <div className="row">
               <div className=".col-md-6.offset-md-3">
                   <h4>registro</h4>
                   {registroForm()}
               </div>
           </div>
        </div>
     );
     }





export default Registro;
